import style from '../components/creatcomponents/creatcomponents.module.css';
import CreatBodySurv from '../components/postcomponents/CreatBodySurv';
import CreatMainTitle from '../components/postcomponents/CreatMainTitle';
import CreatMainContent from '../components/postcomponents/CreatMainContent';
import CreatIntroduce from '../components/postcomponents/CreatIntroduce';
import CreatComent from '../components/postcomponents/Creatoment';
import Header from "../components/Header";
import Survebar from "../components/Survebar";
import styles from '../components/usecomponents.module.css';

function  CreatLayout() {

    return(
            <div className={ styles.container}>
            <Survebar/>
            <Header/>
        
            <div className={ style.postbodystyle }>
                <CreatBodySurv/>
                <CreatMainTitle/>
                <CreatMainContent/>
                <CreatIntroduce/>
                <CreatComent/>
            </div>
            </div>
    )
}

export default CreatLayout;
